import React, { useState } from 'react';
import { login } from '../services/authService';
import { useNavigate } from 'react-router-dom';
import toast from 'react-hot-toast';
import { ShoppingCart } from 'lucide-react';

const LoginPage = () => {
  const [username, setUsername] = useState('kminchelle');
  const [password, setPassword] = useState('0lelplR');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await login(username, password);
      toast.success('Login successful!');
      navigate('/');
    } catch (err) {
      toast.error(err.response?.data?.message || err.message || 'Login failed.');
    }
  };

  return (
    <div className="min-h-screen flex flex-col justify-center items-center bg-gradient-to-br from-blue-100 to-blue-300">
      <div className="flex items-center gap-2 mb-6">
        <ShoppingCart className="w-8 h-8 text-[var(--primary-color)]" />
        <h1 className="text-3xl font-bold text-[var(--primary-color)]">Product Viewer</h1>
      </div>
      <form onSubmit={handleSubmit} className="bg-white p-8 rounded-xl shadow-xl w-80">
        <h2 className="text-2xl font-semibold mb-6 text-center text-[var(--primary-color)]">Login to your account</h2>
        <input
          type="text"
          placeholder="Username"
          className="input-field mb-4"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
        <input
          type="password"
          placeholder="Password"
          className="input-field mb-4"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <button className="btn-primary w-full">Login</button>
      </form>
    </div>
  );
};

export default LoginPage;
